import { Button, TextField } from '@mui/material'
import React from 'react'
import { Link } from 'react-router-dom'
import img_back from '../imgs/previous.png'

function SignUp() {

  const clickHandler = ()=>{
    alert('hello');
  }

  return (
    <div>
      <Link to='/'><img src={img_back} width='45' className='img_back'/></Link>
        <form onSubmit={clickHandler} className='form'>
          <TextField className='form__input' label='nom' variant='filled' required></TextField>
          <TextField className='form__input' label='prenom' variant='filled' required></TextField>
          <TextField className='form__input' label='email' variant='filled' required></TextField>
          <TextField className='form__input' label='age' variant='filled' required></TextField>
          <TextField className='form__input' label='dateNaissance' variant='filled' required></TextField>
          <Button type='submit' variant='contained' color='primary' className='form_submit'>Submit</Button>
        </form>
    </div>
  )
}

export default SignUp
